import React from 'react'

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {value: ''}

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleSubmit(event) {
        alert ('A name was submitted: ' + this.state.value);
        event.preventDefault();
    }

    render() {
        return (
        <form onSubmit={this.handleSubmit}>
            <label>
            Your Input <br />
            {/* Request to Server Response from Server<br /> */}
            <View style={{textAlignVertical: "center", textAlign:"center",}}>
                <Text> Example Text </Text>
            </View>
            <input type="name" value={this.state.value} onChange={this.handleChange} name="name" placeholder="Enter name"/>
            </label>
            <label>
            <input type="ans" value={this.state.value} onChange={this.handleChange} name="ans"/>
            </label>
        </form>
        );
    }
}

export default Home;
